/**
 * @param {any} lower
 * @param {boolean} lowerOpen
 */
/* istanbul ignore next */
export const createIDBKeyRangeLowerBound = (lower, lowerOpen) => IDBKeyRange.lowerBound(lower, lowerOpen)
